       ('2023-11-24 01:51:00.000000', 'The controversial South Korean court decision on comfort women has angered Japan''s Foreign Minister Yoko Kamikawa, who is on her way to Busan this weekend. The post Latest South Korean Court Ruling Asserts Japan Should (Again) Pay Comfort Women first appeared on JAPAN Forward. Related posts: Biden Shows South Korea’s President Yoon How to Enhance the Security of Asia Japan and South Korea Stand Firm in the Face of Provocation from North Korea A New North Korean Missile Threat Faces Japan', '077784e8f6f3fc3a8b2e4b31c0a2dfd2', NULL, 'https://japan-forward.com/latest-south-korean-court-ruling-asserts-japan-should-again-pay-comfort-women/', 'Latest South Korean Court Ruling Asserts Japan Should (Again) Pay Comfort Women'),
       ('2023-11-24 01:28:00.000000', 'North Korean leader Kim Jong Un has said the country''s launch of a military reconnaissance satellite earlier this week was "an exercise of the right to self-defense," official media reported Friday. Kim said possessing the satellite will "actively deter, control and manage various kinds and forms of the dangerous and aggressive moves of the hostile forces," the Korean Central News Agency reported, in an apparent reference to the alliance of the United States, South Korea and Japan. Read full story here', 'ef2564c349a39c60c71855bd433bd409', 'https://img.kyodonews.net/english/public/images/posts/d261e03bc814636184fee6209609dbec/cropped_image_m.jpg', 'https://english.kyodonews.net/news/2023/11/3c2ac60b9c96-n-koreas-kim-says-satellite-part-of-right-to-self-defense.html', 'North Korea''s Kim Jong Un says satellite part of &quot;right to self-defense&quot;'),
       ('2023-11-24 00:56:00.000000', 'Japanese Defense Minister Minoru Kihara said Friday that the government has confirmed "some object" launched by North Korea is "orbiting the Earth," after Pyongyang launched what it has said is a reconnaissance satellite into space earlier this week. Kihara told reporters that the latest assessment was made in collaboration with the United States and South Korea, but refrained from commenting on whether the North''s satellite launch was successful. Read full story here', '476657550ea8ca4a259b612f0679df28', 'https://img.kyodonews.net/english/public/images/posts/60dac9e784e015b22d6a373273e0fc1d/cropped_image_m.jpg', 'https://english.kyodonews.net/news/2023/11/62b821e9911b-japan-confirms-object-launched-into-space-by-n-korea-orbiting-earth.html', 'Japan confirms object launched into space by North Korea orbiting Earth'),
